import React from 'react';

import '../Styles/shop.scss';

class Shop extends React.Component{
  render(){
    return(

      <div className = "shop-container">
        <h4> Where I shop </h4>
        <ul>
          <li><a href = "https://us.princesspolly.com/" target = "_blank">Princess Polly Boutique</a></li>
          <li><a href = "https://www.uniqlo.com/us/en/home/">Uniqlo</a></li>
          <li><a href = "https://mollyandzoey.com/">Molly and Zoey</a></li>
          <li><a href = "https://luckiclover.shop/">Lucki Clover</a></li>
          <li><a href = "https://www.prettylittlething.us/">Pretty Little Thing</a></li>
          <li><a href = "https://www.fashionnova.com/">Fashion Nova</a></li>
          <li><a href = "https://us.shein.com/?ref=www&rep=dir&ret=us">Shein</a></li>
          <li><a href = "https://www.zaful.com/">Zaful</a></li>

        </ul>
      </div>

    );
  }
}
export default Shop;
